INSERT INTO `tbl_sekolah` (`id_sekolah`, `nama_sekolah`, `status`, `id_jenjang`, `id_kecamatan`, `alamat`, `posisi`, `deskripsi`, `foto`) VALUES
(1, 'SMK Muhammadiyah Kajen', 'Swasta', 5, 1, 'Jl. Pahlawan - Kajen Kabupaten Pekalongan 51161', '-7.021406, 109.584096', 'SMK Muhammadiyah Kajen Kabupaten Pekalongan, didirikan Pimpinan Cabang Muhammadiyah Kajen Kabupaten Pekalongan tahun 2002. Para tokoh pendidikan dan kalangan muda bermimpi, di Kajen harus ada Sekolah Kejuruan, melengkapi sekolah/madrasah yang ada.', 'KNRpF9izqnL1Ls8oxleVa8DYeXGuXuK6xADc5pZg.jpg'),
(2, 'MTs MUHAMMADIYAH KAJEN', 'Swasta', 3, 1, 'Jl. DIPONEGORO NO.754 KEL. KAJEN KEC. KAJEN', '-7.029770090932251,109.57867069644132', NULL, 'RWN33bwHtV2KvmbKo3ISADVJl3xosw96nRYbNJnU.png'),
(4, 'SD Muhammadiyah Kajen', 'Swasta', 8, 1, 'Jl Diponegoro 754, Kajen, Kec. Kajen, Kab. Pekalongan, Jawa Tengah, dengan kode pos 51161', '-7.0298374739676195,109.57921386850737', 'SD MUHAMMADIYAH KAJEN adalah salah satu satuan pendidikan dengan jenjang SD di Kajen, Kec. Kajen, Kab. Pekalongan, Jawa Tengah. Dalam menjalankan kegiatannya, SD MUHAMMADIYAH KAJEN berada di bawah naungan Kementerian Pendidikan dan Kebudayaan.', 'HsFBBQ37xSJS7hffMbVGjlWC9uT2B6WqnUDFQyIs.jpg'),
(5, 'SMA N 1 Kajen', 'Negeri', 6, 1, 'Jl. Mandurorejo Kajen No.446, Nyamok, Kec. Kajen, Kabupaten Pekalongan, Jawa Tengah 51161', '-7.0278587379485815,109.58569243917991', 'SMA Negeri 1 Kajen Kabupaten Pekalongan berdiri sejak tanggal 5 Januari 1980 dan diresmikan penggunaannya oleh Bupati Pekalongan, Karsono. SMA Negeri 1 Kajen merupakan sekolah tertua di Kabupaten Pekalongan.\r\nHasil lulusannya telah tersebar di berbagai daerah di Indonesia baik di pemerintahan maupun swasta, baik sebagai dokter, insinyur, dosen, guru, politisi ataupun yang lainnya. SMA Negeri 1 Kajen memiliki potensi yang sangat besar dan posisi yang strategis untuk dikembangkan menjadi sekolah unggulan, yakni memiliki area yang cukup luas dan terletak di pusat pemerintahan sehingga mudah dijangkau dan mudah untuk mengakses berbagai pelayanan umum. Jalur SMA Negeri 1 Kajen dilalui oleh transportasi umum dan dikelilingi oleh perkantoran serta tidak jauh dengan tempat pariwisata di Kabupaten Pekalongan. Sehingga tidak mengherankan bila dalam perkembangannya, SMA Negeri 1 Kajen telah mampu berprestasi baik di tingkat Kabupaten, Provinsi, Nasional maupun Internasional', 'unYh1WWHzz6nmnBowqvOx1NbpiUMEexbJZzCBO7G.jpg');

